import P from "prop-types";
import "./styles.css";

export default function PostCard({ title, cover, body, id }) {
  <div className="post">
    <img src={cover} alt={title} />
    <div className="post-content">
      <h2>
        {title} {id}
      </h2>
      <p>{body}</p>
    </div>
  </div>;
}
